import React, { Component } from 'react';
import UserService from '../services/UserService';



class UpdateUserComponent extends Component {


  constructor(props) {
    super(props);

    this.state = {
      id:"",
      taskName: "",
      description: '',
      startDate: '',
      endDate: '',
      taskStatus: '',
      totalEffortReq: '',
    };
    this.changeIdHandler = this.changeIdHandler.bind(this)
    this.changeTaskNameHandler = this.changeTaskNameHandler.bind(this);
    this.changeDescriptionHandler = this.changeDescriptionHandler.bind(this);
    this.changeStartDateHandler = this.changeStartDateHandler.bind(this);
    this.changeEndDateHandler = this.changeEndDateHandler.bind(this);
    this.changeTaskStatusHandler = this.changeTaskStatusHandler.bind(this);
    this.changeTotalEffortReqHandler = this.changeTotalEffortReqHandler.bind(this);
    this.updateTask = this.updateTask.bind(this);
  }

  componentDidMount() {
    UserService.getUserById(this.state.id).then((res) => {
      let task = res.data;
      this.setState({
        id: task.id,
        taskName: task.taskName,
        description: task.description,
        startDate: task.startDate,
        endDate: task.endDate,
        taskStatus: task.taskStatus,
        totalEffortReq: task.totalEffortReq,
      });
    });
  }

  updateTask =(e) => {
    e.preventDefault();
    let task = {
      id: this.state.id,
      taskName: this.state.taskName,
      description: this.state.description,
      startDate: this.state.startDate,
      endDate: this.state.endDate,
      taskStatus: this.state.taskStatus,
      totalEffortReq: this.state.totalEffortReq,
    };
    console.log('task => ' + JSON.stringify(task));
    console.log('id => ' + JSON.stringify(this.state.id));
    UserService.updateTask(this.state.id,task).then((res) => {
      this.props.history.push('/'); // Redirect to the task list after updating the task
    });
  }

  changeIdHandler(event) {
    this.setState({ id: event.target.value });
  } 

  changeTaskNameHandler(event) {
    this.setState({ taskName: event.target.value });
  }

  changeDescriptionHandler(event) {
    this.setState({ description: event.target.value });
  }

  changeStartDateHandler(event) {
    this.setState({ startDate: event.target.value });
  }

  changeEndDateHandler(event) {
    this.setState({ endDate: event.target.value });
  }

  changeTaskStatusHandler(event) {
    this.setState({ taskStatus: event.target.value });
  }

  changeTotalEffortReqHandler(event) {
    this.setState({ totalEffortReq: event.target.value });
  }

  cancel() {
    this.props.history.push('/');
  }

  render() {
    return (
      <div>
        <br></br>
        <div className="container">
          <div className="row">
            <div className="card col-md-6 offset-md-3 offset-md-3">
              <h3 className="text-center">Update Task</h3>
              <div className="card-body">
                <form>
                <div className="form-group">
                    <label> Id </label>
                    <input
                      placeholder="Id"
                      name="id"
                      className="form-control"
                      value={this.state.id}
                      onChange={this.changeIdHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> TaskName </label>
                    <input
                      placeholder="TaskName"
                      name="taskName"
                      className="form-control"
                      value={this.state.taskName}
                      onChange={this.changeTaskNameHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Description </label>
                    <input
                      placeholder="Description"
                      name="description"
                      className="form-control"
                      value={this.state.description}
                      onChange={this.changeDescriptionHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> StartDate </label>
                    <input
                      placeholder="StartDate"
                      name="startDate"
                      className="form-control"
                      value={this.state.startDate}
                      onChange={this.changeStartDateHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> EndDate </label>
                    <input
                      placeholder="EndDate"
                      name="endDate"
                      className="form-control"
                      value={this.state.endDate}
                      onChange={this.changeEndDateHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> TaskStatus </label>
                    <input
                      placeholder="TaskStatus"
                      name="taskStatus"
                      className="form-control"
                      value={this.state.taskStatus}
                      onChange={this.changeTaskStatusHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> TotalEffortReq </label>
                    <input
                      placeholder="TotalEffortReq"
                      name="totalEffortReq"
                      className="form-control"
                      value={this.state.totalEffortReq}
                      onChange={this.changeTotalEffortReqHandler}
                    />
                  </div>

                  <button className="btn btn-success" onClick={this.updateTask}>
                    Save
                  </button>
                  <button
                    className="btn btn-danger"
                    onClick={this.cancel.bind(this)}
                    style={{ marginLeft: '10px' }}
                  >
                    Cancel
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default UpdateUserComponent;
